import { UserAuth } from '../context/AuthContext';

const Navbar = () => {
  const { user, logout } = UserAuth();

  const handleLogout = () => {
    logout();
  };

  return (
    <nav>
      {user ? (
        <>
          <p>Bem-vindo, {user.name}</p>
          <button onClick={handleLogout}>Sair</button>
        </>
      ) : (
